import React from 'react';
import './task2.css';
class Task2 extends React.Component{
    render(){
        return(
            <div className='Table'>
                <button>Item1</button>
                <button>Item2</button>
                <button>Item3</button>
                <button>Item4</button>
            </div>
        )
    }
}
export default Task2;
